def solution():
    def f(x):
        if x % 21 == 0:
            return x // 21
        elif x % 7 == 0:
            return 3 * x
        elif x % 3 == 0:
            return 7 * x
        else:
            return x + 3

    initial_value = 2
    original_value = initial_value
    for a in range(2, 100):  # We start from 2 and go up to a large number to find the smallest a
        current_value = initial_value
        for _ in range(a):
            current_value = f(current_value)
        if current_value == original_value:
            return a
    return None

