def solution():
    # Define the domain for function (3)
    domain_function_3 = {-5, -4, -3, -2, -1, 0, 1, 2}

    # Define the points for each function
    # Function (2): A parabola y = x^2 - 2x
    # We need to determine if it's invertible
    function_2_points = set()
    for x in range(-10, 11):
        y = x**2 - 2*x
        function_2_points.add((x, y))

    # Function (3): A set of discrete points
    function_3_points = {(x, y) for x, y in zip(domain_function_3, [3, 5, 1, 0, 2, -4, -3, -2])}

    # Function (4): A line y = -arctan(x)
    # We need to determine if it's invertible
    function_4_points = set()
    for x in range(-10, 11):
        y = -math.atan(x)
        function_4_points.add((x, y))

    # Function (5): A hyperbola y = 4/x
    # We need to determine if it's invertible
    function_5_points = set()
    for x in range(-10, 11):
        if x != 0:
            y = 4 / x
            function_5_points.add((x, y))

    # Check if each function is invertible
    def is_invertible(points):
        return len(points) == len(set(point[1] for point in points))

    invertible_functions = []

    if is_invertible(function_2_points):
        invertible_functions.append(2)
    if is_invertible(function_3_points):
        invertible_functions.append(3)
    if is_invertible(function_4_points):
        invertible_functions.append(4)
    if is_invertible(function_5_points):
        invertible_functions.append(5)

    # Return the product of the labels of the invertible functions
    return math.prod(invertible_functions)

