def solution():
    import math

    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True

    def greatest_prime_factor(n):
        i = 2
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
        return n

    def p(x):
        floor_x = int(x)
        if is_prime(floor_x):
            return x + 1
        else:
            y = greatest_prime_factor(floor_x)
            return p(y) + (x + 1 - floor_x)

    # Calculate the range of p(x) for 2 <= x <= 10
    results = []
    for x in range(2, 11):
        results.append(p(x))
    for x in [2.5, 3.5, 4.5, 5.5, 6.5, 7.5, 8.5, 9.5]:
        results.append(p(x))

    min_value = min(results)
    max_value = max(results)
    return f"({min_value}, {max_value})"

print(solution())
```

