def solution():
    # We need to find the largest three-digit number with distinct digits in a geometric sequence.
    # A geometric sequence means that the ratio between consecutive terms is constant.
    # Let's denote the digits as a, ar, ar^2 where a is the first term and r is the common ratio.

    # Since we are looking for a three-digit number, the maximum value of a * r^2 should be less than 1000 but greater than or equal to 100.
    # Also, a, ar, and ar^2 must be distinct integers and each must be between 0 and 9.

    # Iterate from the highest possible hundreds digit (9) downwards
    for a in range(9, 0, -1):
        # Check for each possible common ratio r
        for r in range(3, 0, -1):  # r can't be 1 because then all digits would be the same
            if r == 2:
                b = a * r
                c = a * r * r
                if 0 <= b <= 9 and 0 <= c <= 9 and len(set([a, b, c])) == 3:
                    return int(f"{a}{b}{c}")
            elif r == 3:
                b = a * r
                c = a * r * r
                if 0 <= b <= 9 and 0 <= c <= 9 and len(set([a, b, c])) == 3:
                    return int(f"{a}{b}{c}")
    return None

print(solution())
